CREATE TABLE `ID` (
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户ID',
  `nickname` varbinary(32) NOT NULL COMMENT '用户名',
  `passwd` varchar(32) NOT NULL COMMENT '密码',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `phone_num` varchar(16) NOT NULL COMMENT '电话号码',
  `gender` char(1) NOT NULL DEFAULT 'F' COMMENT '性别 F：女性(默认)，M：男性',
  `birthday` date NOT NULL DEFAULT '2016-08-10' COMMENT '出生日期,只记录年月日',
  `photo_url` varchar(128) NOT NULL DEFAULT 'users/photo/default.png' COMMENT '头像地址',
  `real_name` varchar(32) DEFAULT NULL COMMENT '(未使用)真实姓名',
  `card_type` varchar(20) DEFAULT 'ID' COMMENT '(未使用)证件类型: ID，默认为身份证',
  `card_num` varchar(32) DEFAULT NULL COMMENT '	(未使用)证件号码',
  `card_img` varchar(128) DEFAULT NULL COMMENT '(未使用)A:正面，B：反面 {"cardImgA": "/style/2015-11-30/14488549632652jpg", "cardImgB": "/style/2015-11-30/14488549632653jpg"}',
  `reg_ip` varchar(32) NOT NULL COMMENT '注册IP',
  `reg_dt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `or_active` char(1) DEFAULT NULL COMMENT '(未使用)是否注册',
  `or_real` char(1) DEFAULT 'N' COMMENT '是否实名认证',
  `alter_dt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `lastlogin_dt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后登录时间',
  `lastlogin_ip` varchar(32) DEFAULT NULL COMMENT '最后登录IP',
  `status` char(1) NOT NULL DEFAULT 'Y' COMMENT 'Y:正常状态，N:阻止状态',
  `id_type` varchar(64) NOT NULL DEFAULT 'N' COMMENT 'N:普通使用手机注册用户，W:微信注册用户，Q:腾讯QQ用户',
  `open_id` varchar(128) DEFAULT NULL COMMENT '微信或者QQ平台用户唯一ID',
  `id_area` varchar(512) DEFAULT NULL COMMENT '用户所在地',
  `login_times` bigint(20) DEFAULT '0' COMMENT '登录次数'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

