--
-- 表的结构 `id_address`
--

CREATE TABLE `id_address` (
  `add_id` bigint(20) UNSIGNED NOT NULL COMMENT '主键',
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `or_default` tinyint(1) DEFAULT '0' COMMENT '是否默认地址',
  `tel` varchar(255) DEFAULT NULL COMMENT '电话',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  `delivery_city` varchar(255) DEFAULT NULL COMMENT '配送城市',
  `delivery_detail` varchar(512) DEFAULT NULL COMMENT '配送详细地址',
  `or_destroy` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `destroy_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  `update_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `create_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `id_card_num` varchar(64) DEFAULT '211481198106222047' COMMENT '身份证编号'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户地址表';

